@astrohipo 그게 뭔 상관?? 저 사람이 보기 힘들든 말든 당신이 무슨 상관이 있음??? 님이 저 사람 어디서 볼 예정임???
저 연예인은 좋든 싫든 어째든 지속적으로 나오니 중요한 부분인데, 저 댓글쓴 일반인은, 당신이 볼것도 아닌데, 대체 무슨 상관이 있음??
뭐, 비판에 반론은 고사하고 면박주고픈 맘은 알겠는데, 제대로 좀 합시다. 에휴.
